import logo from './logo.svg';
import  Compteur  from './Clock';
import {Form} from './Form';
import './App.css';
import  Client  from "./pages/Choix_page/Client";
import { Routes, Route, Link} from "react-router-dom";

function App() {
  return (
    <>
    <div className='box-ensemble'>
        <div className='box-client'></div>
        <div className='box-back_office'></div>
    </div>


      <nav>
        <ul>
          <li>
            <Link to="/"></Link>
          </li>
          <li>
            <Link to="/clocks"></Link>
          </li>
        </ul>
  </nav>
  <Routes>
    <Route path="/">
      <Route path="Client" element={<Client/>}/>
      {/* <Route path="RH" element={<RH/>}/> */}
   </Route>
  </Routes>
    </>
  )
}

export default App;
